import React from 'react'
import Button from 'react-bootstrap/Button'
import Modal from 'react-bootstrap/Modal'
import Form from 'react-bootstrap/Form'
import Col from 'react-bootstrap/Col'
import Card from 'react-bootstrap/Card'
import Table from 'react-bootstrap/Table'
import { List } from 'immutable'
import { apiPost } from '../../utils/api'
import Alert from 'react-bootstrap/Alert';


class EmpFacility extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      id: props.info.id,
      isManager: props.info.isManager ? props.info.isManager : false,
      facilityID: props.info.facilityID,
      packages: List([]),
      trucks: List([]),
    };
    }

  render() {
    return (
      <div>
        <h1>{ this.state.id }</h1>
        <h1>{ this.state.isManager }</h1>
        <h1>{ this.state.facilityID }</h1>
      </div>
    )
    }
}

export default EmpFacility;
